// Solution

function subtract(a, b) {
  return a - b;
}

function multiply(a, b) {
  return a * b;
}

function divide(a, b) {
  return a / b;
}

function add(a, b) {
  return a + b;
}

function operate(operator, a, b) {
  switch (operator) {
    case "+":
      return add(a, b);
    case "-":
      return subtract(a, b);
    case "*":
      return multiply(a, b);
    case "/":
      return divide(a, b);
    default:
      return "Invalid operator";
  }
}

function updateDisplay(value) {
  display.textContent = value;
}

function updateOperator(value) {
  operator = value;
}

function updateOperand(value) {
  if (operand1 === null) {
    operand1 = value;
  } else {
    operand2 = value;
  }
}

function calculate() {
  if (operand1 !== null && operand2 !== null) {
    const result = operate(operator, operand1, operand2);
    updateDisplay(result);
    operand1 = result;
    operand2 = null;
  }
}

function clear() {
  updateDisplay("0");
  operand1 = null;
  operand2 = null;
  operator = null;
}

function handleNumberClick(e) {
  const value = e.target.textContent;
  if (display.textContent === "0") {
    updateDisplay(value);
  } else {
    updateDisplay(display.textContent + value);
  }
  updateOperand(parseFloat(value));
}

function handleOperatorClick(e) {
  const value = e.target.textContent;
  updateOperator(value);
  calculate();
}

function handleClearClick() {
  clear();
}

function handleEqualsClick() {
  calculate();
}

function handleDecimalClick() {
  if (display.textContent.indexOf(".") === -1) {
    updateDisplay(display.textContent + ".");
  }
}

function handleNegativeClick() {
  if (display.textContent.indexOf("-") === -1) {
    updateDisplay("-" + display.textContent);
  } else {
    updateDisplay(display.textContent.slice(1));
  }
}

function handlePercentClick() {
  updateDisplay(parseFloat(display.textContent) / 100);
}

function handleKeyPress(e) {
  const key = e.key;
  if (key === "Enter") {
    handleEqualsClick();
  } else if (key === "Escape") {
    handleClearClick();
  } else if (key === ".") {
    handleDecimalClick();
  } else if (key === "-") {
    handleNegativeClick();
  } else if (key === "%") {
    handlePercentClick();
  } else if (key === "*") {
    handleOperatorClick({ target: { textContent: "*" } });
  } else if (key === "/") {
    handleOperatorClick({ target: { textContent: "/" } });
  } else if (key === "+") {
    handleOperatorClick({ target: { textContent: "+" } });
  } else if (key === "-") {
    handleOperatorClick({ target: { textContent: "-" } });
  } else if (key >= "0" && key <= "9") {
    handleNumberClick({ target: { textContent: key } });
  }
}

